// HasRouter applies the HasEdge predicate on the "router" edge.
func HasRouter() predicate.ServiceInstance {
	return predicate.ServiceInstance(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, RouterTable, RouterColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.Router
		step.Edge.Schema = schemaConfig.ServiceInstance
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasRouterWith applies the HasEdge predicate on the "router" edge with a given conditions (other predicates).
func HasRouterWith(preds ...predicate.Router) predicate.ServiceInstance {
	return predicate.ServiceInstance(func(s *sql.Selector) {
		step := newRouterStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.Router
		step.Edge.Schema = schemaConfig.ServiceInstance
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ServiceInstance) predicate.ServiceInstance {
	return predicate.ServiceInstance(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ServiceInstance) predicate.ServiceInstance {
	return predicate.ServiceInstance(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ServiceInstance) predicate.ServiceInstance {
	return predicate.ServiceInstance(sql.NotPredicates(p))
}
